script: |
  super -f text -I q12171.spq | sort > q12171.out

inputs:
  - name: q12171.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE + + 89 * - 38 * - + col1 NOT BETWEEN - + CAST ( NULL AS INTEGER ) AND + 51 * - 72 * - - col2 * + + col0;
  - name: tab2

outputs:
  - name: q12171.out
    data: |
      46	51	23
      64	77	40
      75	67	58
